```javascript
const { Client, Intents, SlashCommandBuilder } = require('discord.js');

const client = new Client({ intents: [Intents.FLAGS.GUILDS, Intents.FLAGS.GUILD_MEMBERS] });

client.on('ready', () => {
  console.log(`Logged in as ${client.user.tag}!`);
});

client.on('interactionCreate', async interaction => {
  if (!interaction.isCommand()) return;

  const { commandName } = interaction;

  if (commandName === 'ban') {
    const member = interaction.options.getMember('user');
    const reason = interaction.options.getString('reason');

    if (!member) {
      await interaction.reply({ content: 'Please provide a valid user to ban.', ephemeral: true });
      return;
    }

    if (!interaction.guild.members.me.permissions.has('BAN_MEMBERS')) {
      await interaction.reply({ content: 'I need the `BAN_MEMBERS` permission to ban users.', ephemeral: true });
      return;
    }

    await member.ban({ reason });
    await interaction.reply({ content: `Successfully banned ${member.user.tag}!`, ephemeral: true });
  }
});

client.login('YOUR_BOT_TOKEN');
```

**Explanation:**

1. **Import necessary modules:**
   - `Client`: The main Discord.js client object.
   - `Intents`: Used to specify the intents your bot requires.
   - `SlashCommandBuilder`: Used to define slash commands.

2. **Create a new client:**
   - `client = new Client({ intents: [Intents.FLAGS.GUILDS, Intents.FLAGS.GUILD_MEMBERS] });`
     - This creates a new Discord.js client instance.
     - `Intents.FLAGS.GUILDS` is required to access guild information.
     - `Intents.FLAGS.GUILD_MEMBERS` is required to access member information.

3. **`ready` event:**
   - `client.on('ready', () => { ... });`
     - This event fires when the bot is ready and connected to Discord.
     - It logs a message to the console indicating the bot's username.

4. **`interactionCreate` event:**
   - `client.on('interactionCreate', async interaction => { ... });`
     - This event fires whenever a user interacts with a command.
     - `interaction` is an object containing information about the interaction.

5. **Check if it's a slash command:**
   - `if (!interaction.isCommand()) return;`
     - This ensures the code only executes for slash commands.

6. **Get the command name:**
   - `const { commandName } = interaction;`
     - Extracts the name of the invoked command.

7. **Handle the `ban` command:**
   - `if (commandName === 'ban') { ... }`
     - This block executes if the command is `ban`.

8. **Get user and reason:**
   - `const member = interaction.options.getMember('user');`
     - Retrieves the mentioned user from the command options.
   - `const reason = interaction.options.getString('reason');`
     - Retrieves the reason for the ban from the command options.

9. **Error handling:**
   - `if (!member) { ... }`
     - Checks if a user was mentioned.
   - `if (!interaction.guild.members.me.permissions.has('BAN_MEMBERS')) { ... }`
     - Checks if the bot has the `BAN_MEMBERS` permission.

10. **Ban the user:**
    - `await member.ban({ reason });`
      - Bans the mentioned user with the provided reason.

11. **Send a confirmation message:**
    - `await interaction.reply({ content: ... });`
      - Sends a message to the user confirming the ban.

12. **Login with your bot token:**
    - `client.login('YOUR_BOT_TOKEN');`
      - Replace `YOUR_BOT_TOKEN` with your actual bot token.



